// components/Header.js

import React, { Component } from 'react'
import { Input, Menu } from 'semantic-ui-react'
import NavBar from "./NavBar";


const headerStyle = {
    position: "absolute",
    // width: "170px",
    // height: "40px",
    // left: "calc(50% - 170px/2 + 121px)",
    background: "url(https://images.pexels.com/photos/598917/pexels-photo-598917.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500)",


    // width: "2309px",
    height: "1190px",
    // left: "2309px",
    backgroundRepeat:"no-repeat",
    backgroundSize:"cover",
    fontFamily: "Alegreya Sans",
    fontFtyle: "normal",
    fontWeight: "normal",
    fontSize: "30px",
    lineHeight: "36px",
    color: "#F0D8D8",
  };
  
  const Header = () => (
    <div className="Header" style={headerStyle}>
         <NavBar />

    </div>
  );
  
  export default Header;
